INSERT INTO `roles` VALUES ('40c7d82c-d4a7-11f0-8859-025041000001','super_admin','超级管理员','系统最高权限角色，拥有所有权限',1,1,'[\"*:*:*\"]','2025-12-09 10:32:05',NULL,NULL,NULL,NULL),('40c8313f-d4a7-11f0-8859-025041000001','admin','系统管理员','系统管理员角色，可以管理用户、角色、应用等',1,1,'[\"user:*:*\", \"role:read:*\", \"application:*:*\", \"scope:*:*\", \"claim-type:*:*\", \"system-metadata:*:*\"]','2025-12-09 10:32:05',NULL,NULL,NULL,NULL),('40c833e5-d4a7-11f0-8859-025041000001','user_manager','用户管理员','负责用户账号管理',1,1,'[\"user:read:*\", \"user:create:*\", \"user:update:*\", \"user:reset-password:*\"]','2025-12-09 10:32:05',NULL,NULL,NULL,NULL),('40c835bc-d4a7-11f0-8859-025041000001','auditor','审计员','只读权限，可查看所有数据但不能修改',1,1,'[\"user:read:*\", \"role:read:*\", \"application:read:*\", \"scope:read:*\", \"audit-log:read:*\"]','2025-12-09 10:32:05',NULL,NULL,NULL,NULL),('40c8375a-d4a7-11f0-8859-025041000001','user','普通用户','普通用户角色，只能管理自己的信息',1,1,'[\"user:read:own\", \"user:update:own\"]','2025-12-09 10:32:05',NULL,NULL,NULL,NULL),('fb7b6fea-d4bf-11f0-8859-025041000001','developer','开发人员','软件开发工程师角色，可访问开发相关资源',0,1,'[\"application:read:*\", \"scope:read:*\", \"user:read:self\"]','2025-12-09 13:29:07','6cfcc02f-d49c-11f0-8859-025041000001',NULL,NULL,NULL),('fb7bb3ab-d4bf-11f0-8859-025041000001','tester','测试人员','软件测试工程师角色，可进行测试相关操作',0,1,'[\"application:read:*\", \"user:read:*\", \"test:execute:*\"]','2025-12-09 13:29:07','6cfcc02f-d49c-11f0-8859-025041000001',NULL,NULL,NULL),('fb7bb648-d4bf-11f0-8859-025041000001','guest','访客','系统访客角色，仅有只读权限',0,1,'[\"*:read:public\"]','2025-12-09 13:29:07','6cfcc02f-d49c-11f0-8859-025041000001',NULL,NULL,NULL);
