DROP TABLE IF EXISTS `system_logs`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `system_logs` (
  `id` char(36) COLLATE utf8mb4_general_ci NOT NULL COMMENT '日志唯一标识(GUID)',
  `level` varchar(20) COLLATE utf8mb4_general_ci NOT NULL COMMENT '日志级别',
  `message` text COLLATE utf8mb4_general_ci NOT NULL COMMENT '日志消息',
  `exception` text COLLATE utf8mb4_general_ci COMMENT '异常信息',
  `stack_trace` text COLLATE utf8mb4_general_ci COMMENT '异常堆栈跟踪',
  `source` varchar(255) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '异常来源',
  `user_id` char(36) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '操作用户ID',
  `username` varchar(256) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '操作用户名',
  `ip_address` varchar(50) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT 'IP地址',
  `user_agent` text COLLATE utf8mb4_general_ci COMMENT '用户代理',
  `request_path` varchar(500) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '请求路径',
  `request_method` varchar(10) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '请求方法',
  `status_code` int DEFAULT NULL COMMENT 'HTTP状态码',
  `created_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `timestamp` bigint NOT NULL COMMENT '时间戳',
  PRIMARY KEY (`id`),
  KEY `idx_level` (`level`),
  KEY `idx_created_at` (`created_at` DESC),
  KEY `idx_timestamp` (`timestamp` DESC),
  KEY `idx_user_id` (`user_id`),
  KEY `idx_username` (`username`),
  KEY `idx_level_created` (`level`,`created_at` DESC)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci COMMENT='系统日志表';
/*!40101 SET character_set_client = @saved_cs_client */;

