  `is_active` tinyint(1) NOT NULL DEFAULT '1' COMMENT '是否启用',
  `plan` varchar(50) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'free' COMMENT '订阅计划',
  `subscription_expires_at` datetime DEFAULT NULL COMMENT '订阅到期时间',
  `max_users` int DEFAULT NULL COMMENT '最大用户数限制',
  `max_storage_mb` int DEFAULT NULL COMMENT '最大存储空间（MB）',
  `created_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `updated_at` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `created_by` char(36) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '创建者ID',
  `updated_by` char(36) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '更新者ID',
  PRIMARY KEY (`id`),
  UNIQUE KEY `uk_tenants_code` (`code`),
  UNIQUE KEY `uk_tenants_domain` (`domain`),
  KEY `idx_tenants_is_active` (`is_active`),
  KEY `idx_tenants_plan` (`plan`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='租户表';
