  `username` varchar(50) COLLATE utf8mb4_general_ci NOT NULL COMMENT '用户名（登录名）',
  `password_hash` varchar(255) COLLATE utf8mb4_general_ci NOT NULL COMMENT '密码哈希',
  `email` varchar(100) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '邮箱',
  `phone_number` varchar(20) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '手机号',
  `display_name` varchar(100) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '显示名称',
  `avatar` varchar(500) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '头像URL',
  `role` varchar(50) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '角色（admin, user, manager等）',
  `is_active` tinyint(1) NOT NULL DEFAULT '1' COMMENT '是否激活',
  `email_confirmed` tinyint(1) NOT NULL DEFAULT '0' COMMENT '邮箱是否已验证',
  `phone_number_confirmed` tinyint(1) NOT NULL DEFAULT '0' COMMENT '手机号是否已验证',
  `last_login_at` datetime DEFAULT NULL COMMENT '最后登录时间',
  `failed_login_count` int NOT NULL DEFAULT '0' COMMENT '连续登录失败次数',
  `lockout_end` datetime DEFAULT NULL COMMENT '锁定结束时间',
  `lockout_enabled` tinyint(1) NOT NULL DEFAULT '1' COMMENT '是否启用锁定功能',
  `created_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `updated_at` datetime DEFAULT NULL COMMENT '更新时间',
  `created_by` char(36) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '创建者ID',
  `updated_by` char(36) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '更新者ID',
  `remark` varchar(500) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '备注',
  `timestamp` bigint NOT NULL COMMENT '时间戳（用于分页查询）',
  PRIMARY KEY (`id`),
  UNIQUE KEY `uk_username` (`username`),
  UNIQUE KEY `uk_email` (`email`),
  KEY `idx_role` (`role`),
  KEY `idx_is_active` (`is_active`),
  KEY `idx_created_at` (`created_at` DESC),
  KEY `idx_timestamp` (`timestamp`),
  KEY `idx_users_lockout` (`username`,`lockout_end`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci COMMENT='用户表';
